import React from "react";
import "./navbar.css"; // Import CSS for styling

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo-container">
        <img src="/images/logo.jpg" alt="Task Management Logo" className="logo" />
      </div>
      <h1 className="navbar-title">Task Management</h1>
      <div className="button-group">
          <button className="admin-button" onClick={() => (window.location.href = "/admin-login")}>
            Admin
          </button>
          <button className="user-button" onClick={() => (window.location.href = "/user-login")}>
            User
          </button>
        </div>
    </nav>
  );
};

export default Navbar;
